import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  state = {
    sometext: '',
    username: '',
    password: ''
  };
  onChangeTextHandler = event => {
    this.setState({
      sometext: event.target.value
    });
  };
  onChangeUsernameHandler = event => {
    this.setState({
      username: event.target.value
    });
  };
  onChangePasswordHandler = event => {
    this.setState({
      password: event.target.value
    });
  };
  render() {
    return (
      <div className="App">
        {/* comment */}
        <h1>Databinding 1</h1>
        <div>
          some text:
          <input type="text" onChange={this.onChangeTextHandler} />
        </div>
        <h3>You Entered: {this.state.sometext}</h3>

        <h1>Databinding 2</h1>
        <div>
          Username:{' '}
          <input onChange={this.onChangeUsernameHandler} type="text" />
        </div>
        <div>
          Username:{' '}
          <input onChange={this.onChangePasswordHandler} type="password" />
        </div>
      </div>
    );
  }
}

export default App;
